        console.log(currTabIndex);
    }

    const tabs=[
        {
            label:'tab 1',
            content: <div>this is tab 1 content </div>
        },
        {
            label:'tab 2',
            content: <div>this is tab 2 content </div>
        },
        {
            label:'tab 3',
            content: <RandomComponent />
        },
    ]

    return <Tabs tabsContent={tabs} onChange={handleChange} />
}
